      condition: install.vault
      name: vault
      repository: https://helm.releases.hashicorp.com
      version: 0.20.0
    - alias: postgresql
      condition: install.postgresql
      name: postgresql
      repository: https://charts.bitnami.com/bitnami
      version: 12.1.6
    description: 'A Helm chart for an Agent-Enabled Tractus-X Eclipse Data Space Connector.
      This is a variant of [the Tractus-X Connector Helm Chart](https://github.com/eclipse-tractusx/tractusx-edc/tree/main/charts/tractusx-connector)
      which allows to deal with several data (and agent) planes. The connector deployment
      consists of at least two runtime consists of a Control Plane and one or several
      Data Planes. Note that _no_ external dependencies such as a PostgreSQL database
      and HashiCorp Vault are included.  This chart is intended for use with an _existing_
      PostgreSQL database and an _existing_ HashiCorp Vault. '
